import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import { CssBaseline, createTheme, ThemeProvider } from "@mui/material"; // Added ThemeProvider and createTheme

// Setting up the theme
const theme = createTheme({
  palette: {
    primary: {
      main: "#1976d2", // Primary color
    },
    secondary: {
      main: "#dc004e", // Secondary color
    },
    mode: "light", // You can change this to "dark" to enable dark mode
  },
});

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <ThemeProvider theme={theme}>
      <CssBaseline /> {/* Apply Material-UI's baseline styles */}
      <App />
    </ThemeProvider>
  </React.StrictMode>
);
